import {
  FormControl,
  FormLabel,
  Input,
  Textarea,
  Button,
} from "@chakra-ui/react";

function Form() {
  return (
    <form>
      <FormControl>
        <Input placeholder="Title" />
        <Textarea placeholder="Write your notes here..."></Textarea>
      </FormControl>
    </form>
  );
}

export default Form;
